import React from 'react';
import {Row, Col, Container} from 'react-grid-system';
import {work} from '../components/work';
import {spacer1, spacer2, spacer3, spacer4} from '../components/constants';
import Tilt from 'react-tilt';


const workList= work.map(tile=>(
    <Col md={5}>
        <Tilt>
                <a href="#">
                <img src={require(`../images/workImages/${tile.imgLink}.png`)} alt={tile.company} />
                </a>
                </Tilt>

                <h3 style={{marginTop: spacer2}}> {tile.position} </h3>
                <h2 style={{marginTop: spacer1}}> {tile.company} </h2>

    </Col>
));

class Home extends React.Component{
    render(){
        return(
            <div>
                <Container>
                    <Row>

                    </Row>
                    <Row>
                        <Col md={9}>
                            <div style={{}}>
                            <h1>
                                Hi! I'm <span className="stroke">Paridhi</span>.
                            </h1>
                            <h1> 
                                I'm a <span className="stroke">web developer</span> + <span className="stroke">designer</span> 
                                who is about diversity, inclusion and accessibility!
                            </h1>
                            </div>
                        </Col>
                    </Row>
                    <Row justify="center">
                        {workList}
                    </Row>
                </Container>
            </div>
        );
    }
}

export default Home;
